import React, {Component} from 'react'
import {NextPageContext} from "next";
export default class Index extends Component {

    static async getInitialProps({ req }: NextPageContext) {
        const title = 'title';
        return { title }
    }

    render() {
        return (
            <div className="example">
                <h1>{title}</h1>
            </div>
        )
    }
}
